import React, { Component } from 'react'
import styles from '../../style/Admin.module.less'

import { Menu, Dropdown, Icon, message, Button } from 'antd';


function handleMenuClick(e) {
	message.info('Click on menu item.');
	console.log('click', e);
}

const menuData = [
	{ path: '', key: '1', name: '个人信息', icon: 'user' },
	{ path: '', key: '2', name: '个人设置', icon: 'user' },
	{ path: '', key: '3', name: '退出登录', icon: 'user' },
]

const menu = (
	<Menu onClick={handleMenuClick}>
		<Menu.Item key="1">
			<Icon type="user" />
			1st menu item
	  </Menu.Item>
		<Menu.Item key="2">
			<Icon type="user" />
			2nd menu item
	  </Menu.Item>
		<Menu.Item key="3">
			<Icon type="user" />
			3rd item
	  </Menu.Item>
	</Menu>
)


class HeaderNav extends Component {
	// constructor(){
	// super()
	// this.setState
	// }
	render() {
		return (
			<div className={styles.headerNav}>
				<Dropdown overlay={menu}>
					<Button>
						root <Icon type="down" />
					</Button>
				</Dropdown>
			</div>
		)
	}
}

export default HeaderNav
